description:
Category	Feature, Couples, Sweet Sinner's My Daughter's Boyfriend Series

Director	James Avalon
Starring	Adriana Chechik, Tommy Gunn, Marcus London, Scarlet Red, Nikki Daniels, Tyler Nixon

Jill is thrilled that her daughter Pamela is finished with her hoodlum boyfriend and has taken up with an adorable, smart young man. Jill really likes him. Maybe a little too much. Wonder how she'll console him when her daughter decides to go back to her dangerous ex... Starring Nikki Daniels as the hot young-looking mom, Adriana Chechik as the troublesome daughter, and Scarlet Red as the ex-husband's mistress, with Tyler Nixon, Marcus London and Tommy Gunn.
